import React from 'react'

const Userinfo = (props) => {
  return (
    <div>
      <h1>Name:Subham Kumar Tripathy</h1>
      <h2>father name :{props.fname}</h2>
      <h2>Loaction :{props.location}</h2>
    </div>
  )
}

export default Userinfo
